import React from 'react'

export default class Task11 extends React.Component {
  constructor(props) {
    super(props)
    this.text1 = 1
    this.text2 = 2
  }

  getNum1 = () => <p>{this.text1}</p>

  getNum2 = () => <p>{this.text2}</p>

  render() {
    return <div>{this.getNum1() + this.getNum2()}</div>
  }
}
